css:
atom-text-editor::shadow .source.diff span.meta.diff.header.from-file {
  color: #2db448;
}
atom-text-editor::shadow .source.diff span.meta.diff.header.to-file {
  color: #2db448;
}
atom-text-editor::shadow .source.diff span.meta.diff.range.unified,
atom-text-editor::shadow .source.diff span.meta.diff.toc-list.line-number {
  color: #d5880b;
}
atom-text-editor::shadow .source.diff span.markup.deleted.diff,
atom-text-editor::shadow .source.diff span.markup.deleted.diff span.punctuation.definition.diff {
  color: #ff1414;
}
atom-text-editor::shadow .source.diff span.markup.inserted.diff,
atom-text-editor::shadow .source.diff span.markup.inserted.diff span.punctuation.definition.diff {
  color: #2db448;
}
